<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
    <title>이드 연습</title>
    
    <style>
        
        :root { --vh: 100vh; }
        body { margin: 0; padding: 0; width: 100vw; height: 100vh; height: 100dvh; background-color: #050505; display: flex; align-items: center; justify-content: center; overflow: hidden; font-family: Inter, sans-serif; }
        #game-container { position: relative; width: min(100vw, 177.78vh); width: min(100vw, 177.78dvh); height: min(100vh, 56.25vw); height: min(100dvh, 56.25vw); background: #000; overflow: hidden; box-shadow: 0 0 50px rgba(0,0,0,0.5); }
        #scene-layer { position: absolute; top: 0; left: 0; width: 100%; height: 100%; background-size: cover; background-position: center; transition: background-image 0.5s ease; }
        #character-layer { position: absolute; top: 0; left: 0; width: 100%; height: 100%; pointer-events: none; }
        #effect-layer { position: absolute; inset: 0; pointer-events: none; z-index: 10; }
        .character-wrapper { position: absolute; bottom: 0; transform-origin: bottom center; height: 80%; width: max-content; display: flex; align-items: flex-end; justify-content: center; transition: left 0.5s ease-in-out, bottom 0.5s ease-in-out, transform 0.5s ease-in-out, opacity 0.3s ease; }
        .character-img { height: 100%; width: auto; object-fit: contain; }
        
@keyframes breathing { 0%, 100% { transform: scale(1); } 50% { transform: scale(1.02); } }
@keyframes hopping { 0%, 100% { transform: translateY(0); } 50% { transform: translateY(-15px); } }
@keyframes shaking { 0% { transform: translate(1px, 1px) rotate(0deg); } 10% { transform: translate(-1px, -2px) rotate(-1deg); } 20% { transform: translate(-3px, 0px) rotate(1deg); } 30% { transform: translate(3px, 2px) rotate(0deg); } 40% { transform: translate(1px, -1px) rotate(1deg); } 50% { transform: translate(-1px, 2px) rotate(-1deg); } 60% { transform: translate(-3px, 1px) rotate(0deg); } 70% { transform: translate(3px, 1px) rotate(-1deg); } 80% { transform: translate(-1px, -1px) rotate(1deg); } 90% { transform: translate(1px, 2px) rotate(0deg); } 100% { transform: translate(1px, -2px) rotate(-1deg); } }
@keyframes swaying { 0%, 100% { transform: rotate(-2deg); } 50% { transform: rotate(2deg); } }
@keyframes nodding { 0%, 100% { transform: translateY(0); } 25% { transform: translateY(5px); } 50% { transform: translateY(0); } 75% { transform: translateY(5px); } }
@keyframes headShake { 0%, 100% { transform: translateX(0); } 25% { transform: translateX(-5px) rotate(-2deg); } 75% { transform: translateX(5px) rotate(2deg); } }
@keyframes floating { 0%, 100% { transform: translateY(0); } 50% { transform: translateY(-20px); } }
@keyframes zooming { 0%, 100% { transform: scale(1); } 50% { transform: scale(1.1); } }
@keyframes tilting { 0%, 100% { transform: rotate(0deg); } 50% { transform: rotate(5deg); } }
@keyframes flash { 0%, 100% { opacity: 1; } 50% { opacity: 0.3; } }
        
.anim-breathing { animation: breathing 2s infinite ease-in-out; }
.anim-hopping { animation: hopping 2s infinite ease-in-out; }
.anim-shaking { animation: shaking 0.5s infinite ease-in-out; }
.anim-swaying { animation: swaying 2s infinite ease-in-out; }
.anim-nodding { animation: nodding 1s infinite ease-in-out; }
.anim-headShake { animation: headShake 1s infinite ease-in-out; }
.anim-floating { animation: floating 2s infinite ease-in-out; }
.anim-zooming { animation: zooming 2s infinite ease-in-out; }
.anim-tilting { animation: tilting 2s infinite ease-in-out; }
.anim-flash { animation: flash 2s infinite ease-in-out; }
        
@keyframes text-wavy { 0%, 100% { transform: translateY(0); } 50% { transform: translateY(-6px); } }
@keyframes text-shaking { 0% { transform: translate(0,0); } 25% { transform: translate(1px, 1px); } 50% { transform: translate(-1px, -1px); } 75% { transform: translate(1px, -1px); } 100% { transform: translate(0,0); } }
@keyframes text-rainbow { 0% { color: #ff5555; } 20% { color: #ffff55; } 40% { color: #55ff55; } 60% { color: #55ffff; } 80% { color: #5555ff; } 100% { color: #ff55ff; } }
@keyframes text-bounce { 0%, 100% { transform: scaleY(1); } 50% { transform: scaleY(1.3) translateY(-2px); origin-y: bottom; } }
@keyframes text-glitch { 0% { transform: skew(0deg); opacity: 1; } 20% { transform: skew(-10deg); opacity: 0.8; } 40% { transform: skew(10deg); opacity: 1; } 60% { transform: skew(-5deg); opacity: 0.9; } 80% { transform: skew(5deg); opacity: 1; } 100% { transform: skew(0deg); opacity: 1; } }
@keyframes text-zoom { 0%, 100% { transform: scale(1); } 50% { transform: scale(1.15); } }
@keyframes text-fade { 0%, 100% { opacity: 1; } 50% { opacity: 0.4; } }
@keyframes text-rotate { 0% { transform: rotate(0deg); } 25% { transform: rotate(5deg); } 75% { transform: rotate(-5deg); } 100% { transform: rotate(0deg); } }
@keyframes text-blur { 0%, 100% { filter: blur(0); } 50% { filter: blur(1.5px); } }
@keyframes text-slide { 0%, 100% { transform: translateX(0); } 50% { transform: translateX(3px); } }
@keyframes text-cursor-blink { 0%, 100% { opacity: 1; } 50% { opacity: 0; } }
        
.text-anim-wavy span { display: inline-block; animation: text-wavy var(--text-anim-duration, 1s) infinite ease-in-out; }
.text-anim-shaking span { display: inline-block; animation: text-shaking var(--text-anim-duration, 1s) infinite ease-in-out; }
.text-anim-rainbow span { display: inline-block; animation: text-rainbow var(--text-anim-duration, 1s) infinite ease-in-out; }
.text-anim-bounce span { display: inline-block; animation: text-bounce var(--text-anim-duration, 1s) infinite ease-in-out; }
.text-anim-glitch span { display: inline-block; animation: text-glitch var(--text-anim-duration, 1s) infinite ease-in-out; }
.text-anim-zoom span { display: inline-block; animation: text-zoom var(--text-anim-duration, 1s) infinite ease-in-out; }
.text-anim-fade span { display: inline-block; animation: text-fade var(--text-anim-duration, 1s) infinite ease-in-out; }
.text-anim-rotate span { display: inline-block; animation: text-rotate var(--text-anim-duration, 1s) infinite ease-in-out; }
.text-anim-blur span { display: inline-block; animation: text-blur var(--text-anim-duration, 1s) infinite ease-in-out; }
.text-anim-slide span { display: inline-block; animation: text-slide var(--text-anim-duration, 1s) infinite ease-in-out; }
.text-anim-typewriter::after { content: '▋'; display: inline-block; margin-left: 2px; animation: text-cursor-blink var(--text-anim-duration, 1s) step-end infinite; color: inherit; vertical-align: baseline; font-size: 0.9em; }
        

      @keyframes fx-fade-black { from { background-color: black; opacity: 1; } to { background-color: transparent; opacity: 0; } }
      .fx-fade-black { animation: fx-fade-black 1.5s ease-out forwards; pointer-events: none; background-color: black; }
    

      @keyframes fx-fade-white { from { background-color: white; opacity: 1; } to { background-color: transparent; opacity: 0; } }
      .fx-fade-white { animation: fx-fade-white 1.5s ease-out forwards; pointer-events: none; background-color: white; }
    

      @keyframes fx-slide-left { from { transform: translateX(-100%); background-color: black; opacity: 1; } to { transform: translateX(100%); background-color: black; opacity: 0; } }
      .fx-slide-left { position: absolute; inset: 0; background-color: black; animation: fx-slide-left 1s ease-in-out forwards; pointer-events: none; }
    

      @keyframes fx-flash { 0% { background-color: white; opacity: 0; } 10% { opacity: 0.8; } 100% { opacity: 0; } }
      .fx-flash { animation: fx-flash 0.5s ease-out forwards; pointer-events: none; background-color: white; }
    

      @keyframes fx-shake-screen { 
        0% { transform: translate(0, 0); } 
        10% { transform: translate(-5px, -5px); } 
        20% { transform: translate(5px, 5px); } 
        30% { transform: translate(-5px, 5px); } 
        40% { transform: translate(5px, -5px); } 
        50% { transform: translate(-3px, 3px); } 
        60% { transform: translate(3px, -3px); } 
        70% { transform: translate(0, 0); } 
      }
      /* Applies to the container itself if possible, but here we use a trick or just simulate via overlay if needed, 
         but ideally this class should be applied to the #game-container in exporter. 
         For editor, we might need a wrapper. For now, we simulate visual chaos via zoom/rotate on overlay */
      .fx-shake { animation: fx-shake-screen 0.5s ease-in-out; }
    

      @keyframes fx-rain { 0% { background-position: 0 0; } 100% { background-position: 20% 100%; } }
      .fx-rain { 
        background-image: linear-gradient(to bottom, rgba(255,255,255,0) 0%, rgba(255,255,255,0.4) 50%, rgba(255,255,255,0) 100%);
        background-size: 2px 30px;
        animation: fx-rain 0.4s linear infinite;
        opacity: 0.5;
        pointer-events: none;
      }
    

      @keyframes fx-snow { 0% { background-position: 0 0, 0 0; } 100% { background-position: 50px 300px, -50px 150px; } }
      .fx-snow {
        background-image: radial-gradient(white 2px, transparent 3px), radial-gradient(rgba(255,255,255,0.8) 1px, transparent 2px);
        background-size: 50px 50px, 40px 40px;
        animation: fx-snow 4s linear infinite;
        opacity: 0.8;
        pointer-events: none;
      }
    

        @keyframes fx-fog { 0% { background-position: 0 0; } 100% { background-position: -200% 0; } }
        .fx-fog {
            background: linear-gradient(to right, rgba(200,200,200,0.2), rgba(255,255,255,0.4), rgba(200,200,200,0.2));
            background-size: 200% 100%;
            animation: fx-fog 10s linear infinite;
            pointer-events: none;
        }
      

      @keyframes fx-grain { 0%, 100% { transform: translate(0, 0); } 10% { transform: translate(-5%, -5%); } 50% { transform: translate(5%, 5%); } }
      .fx-old-film {
        background-color: rgba(112, 66, 20, 0.2);
        box-shadow: inset 0 0 100px rgba(0,0,0,0.7);
        pointer-events: none;
      }
      .fx-old-film::before {
        content: "";
        position: absolute;
        inset: -50%;
        width: 200%;
        height: 200%;
        background-image: repeating-radial-gradient(#000 0 0.0001%, #fff 0 0.0002%);
        opacity: 0.1;
        animation: fx-grain 0.5s steps(1) infinite;
        pointer-events: none;
        mix-blend-mode: overlay;
      }
      /* Note: We also apply a sepia filter to the container usually, but overlay is safer for now */
    

      .fx-vignette {
        background: radial-gradient(circle, transparent 50%, black 140%);
        pointer-events: none;
      }
    

      .fx-blur {
        backdrop-filter: blur(5px);
        background-color: rgba(255,255,255,0.1);
        pointer-events: none;
      }
    

      @keyframes fx-pulse-red { 0% { box-shadow: inset 0 0 0 rgba(255,0,0,0); } 50% { box-shadow: inset 0 0 50px rgba(255,0,0,0.5); } 100% { box-shadow: inset 0 0 0 rgba(255,0,0,0); } }
      .fx-heartbeat {
        animation: fx-pulse-red 1s ease-in-out infinite;
        pointer-events: none;
      }
    

        .fx-night-vision {
            background-color: rgba(0, 255, 0, 0.1);
            background-image: linear-gradient(rgba(18, 16, 16, 0) 50%, rgba(0, 0, 0, 0.25) 50%), linear-gradient(90deg, rgba(255, 0, 0, 0.06), rgba(0, 255, 0, 0.02), rgba(0, 0, 255, 0.06));
            background-size: 100% 2px, 3px 100%;
            pointer-events: none;
            mix-blend-mode: hard-light;
        }
      

        @keyframes fx-dream-pulse { 0%, 100% { opacity: 0.3; filter: blur(2px); } 50% { opacity: 0.6; filter: blur(4px); } }
        .fx-dream {
            background: radial-gradient(circle, rgba(255,255,255,0.2), rgba(255,200,255,0.4));
            animation: fx-dream-pulse 3s infinite alternate;
            mix-blend-mode: screen;
            pointer-events: none;
        }
      

        .fx-sunset {
            background: linear-gradient(to bottom, rgba(255, 100, 0, 0.2), rgba(100, 0, 100, 0.3));
            mix-blend-mode: overlay;
            pointer-events: none;
        }
      
        .char-span { opacity: 0; display: inline-block; white-space: pre-wrap; }
        .char-visible { opacity: 1; }
        #ui-layer { position: absolute; bottom: 0; left: 0; width: 100%; padding: 3%; box-sizing: border-box; display: flex; justify-content: center; z-index: 20; pointer-events: none; }
        #dialogue-box { width: 100%; max-width: 1000px; background-color: #000000; border: 2px solid #ffffff; border-radius: 8px; color: #ffffff; padding: 20px 20px; cursor: pointer; user-select: none; pointer-events: auto; max-height: 40vh; display: flex; flex-direction: column; overflow-y: auto; scrollbar-width: thin; scrollbar-color: rgba(255,255,255,0.3) transparent; }
        #dialogue-box::-webkit-scrollbar { width: 6px; }
        #dialogue-box::-webkit-scrollbar-track { background: transparent; }
        #dialogue-box::-webkit-scrollbar-thumb { background-color: rgba(255,255,255,0.3); border-radius: 3px; }
        #speaker-name { font-weight: bold; font-size: clamp(1rem, 2.5vh, 1.5rem); margin-bottom: 0.5rem; align-self: flex-start; border-radius: 4px; background-color: transparent; padding: 0 10px; color: #fbbf24; flex-shrink: 0; }
        #dialogue-text { font-size: clamp(0.9rem, 2.2vh, 1.3rem); line-height: 1.5; white-space: pre-wrap; word-break: keep-all; min-height: 3em; }
        
        #choices-layer, #input-layer { 
            position: absolute; inset: 0; display: none; flex-direction: column; align-items: center; justify-content: center; gap: 1rem; z-index: 30; background-color: rgba(0,0,0,0.5); backdrop-filter: blur(2px); 
        }
        
        #input-box { background: rgba(15, 23, 42, 0.95); padding: 30px; border-radius: 12px; border: 1px solid rgba(255,255,255,0.1); width: 100%; max-width: 400px; box-shadow: 0 20px 25px rgba(0,0,0,0.5); display: flex; flex-direction: column; align-items: center; }
        #player-input-field { width: 100%; padding: 12px 16px; font-size: 1.1rem; background: rgba(0,0,0,0.4); border: 2px solid #334155; border-radius: 8px; color: white; margin-bottom: 20px; outline: none; transition: border-color 0.2s; }
        #player-input-field:focus { border-color: #6366f1; }
        .input-submit-btn { width: 100%; padding: 12px; background: #6366f1; color: white; border: none; border-radius: 8px; font-weight: bold; font-size: 1.1rem; cursor: pointer; transition: background 0.2s; }
        .input-submit-btn:hover { background: #4f46e5; }

        .choice-btn { background-color: #0f172a; color: #ffffff; border: 1px solid #94a3b8; border-radius: 8px; padding: 1rem 2rem; font-size: 1.2rem; min-width: 300px; max-width: 80%; cursor: pointer; transition: all 0.2s; box-shadow: 0 4px 6px rgba(0,0,0,0.3); font-family: Inter, sans-serif; }
        .choice-btn:hover { transform: scale(1.05); filter: brightness(1.2); }
        #start-overlay { position: absolute; inset: 0; color: white; display: flex; flex-direction: column; align-items: center; justify-content: center; z-index: 50; }
        #start-overlay h1 { font-size: clamp(2rem, 5vh, 4rem); margin-bottom: 2rem; text-shadow: 0 4px 6px rgba(0,0,0,0.5), 0 0 20px rgba(0,0,0,0.8); text-align: center; padding: 0 20px; }
        button.start-btn { padding: 10px 20px; font-size: 1.2rem; cursor: pointer; background: white; color: black; border: none; border-radius: 4px; box-shadow: 0 4px 6px rgba(0,0,0,0.3); transition: transform 0.1s; }
        button.start-btn:hover { transform: scale(1.05); }
        #system-menu { position: absolute; top: 15px; right: 15px; z-index: 40; display: flex; gap: 8px; }
        .sys-btn { background: rgba(0,0,0,0.6); border: 1px solid rgba(255,255,255,0.2); color: rgba(255,255,255,0.8); padding: 4px 12px; border-radius: 20px; font-size: 0.8rem; cursor: pointer; backdrop-filter: blur(4px); transition: all 0.2s; }
        .sys-btn:hover { background: rgba(255,255,255,0.2); color: white; border-color: rgba(255,255,255,0.5); }
        .modal-overlay { position: absolute; inset: 0; background: rgba(0,0,0,0.85); backdrop-filter: blur(5px); z-index: 100; display: none; flex-direction: column; align-items: center; justify-content: center; color: white; padding: 20px; }
        .modal-content { background: #1e293b; border: 1px solid #475569; border-radius: 8px; width: 100%; max-width: 600px; max-height: 80vh; display: flex; flex-direction: column; box-shadow: 0 10px 25px rgba(0,0,0,0.5); }
        .modal-header { padding: 15px; border-bottom: 1px solid #334155; display: flex; justify-content: space-between; align-items: center; font-weight: bold; font-size: 1.2rem; }
        .modal-close { background: none; border: none; color: #94a3b8; font-size: 1.5rem; cursor: pointer; }
        .modal-close:hover { color: white; }
        .modal-body { padding: 20px; overflow-y: auto; flex: 1; }
        .backlog-entry { margin-bottom: 15px; border-bottom: 1px solid #334155; padding-bottom: 10px; }
        .backlog-entry:last-child { border-bottom: none; }
        .backlog-speaker { color: #fbbf24; font-weight: bold; margin-bottom: 4px; font-size: 0.9rem; }
        .backlog-text { color: #e2e8f0; line-height: 1.5; font-size: 1rem; }
        .slot-grid { display: grid; grid-template-columns: repeat(auto-fill, minmax(250px, 1fr)); gap: 15px; }
        .save-slot { background: #0f172a; border: 2px solid #334155; border-radius: 8px; padding: 15px; cursor: pointer; transition: all 0.2s; text-align: center; }
        .save-slot:hover { border-color: #6366f1; background: #1e1b4b; }
        .slot-title { font-weight: bold; margin-bottom: 5px; color: #cbd5e1; }
        .slot-date { font-size: 0.8rem; color: #64748b; }
        .slot-empty { color: #475569; font-style: italic; }
        @media (max-height: 600px) and (orientation: landscape) {
            #ui-layer { padding: 10px 20px; }
            #dialogue-box { padding: 10px 15px; border-width: 1px; }
            #speaker-name { font-size: 1rem; margin-bottom: 0.2rem; }
            #dialogue-text { font-size: 0.95rem; line-height: 1.3; min-height: auto; }
            .choice-btn { padding: 0.6rem 1.2rem; font-size: 1rem; min-width: 200px; }
            #system-menu { top: 10px; right: 10px; }
        }
    </style>
</head>
<body>

<div id="game-container">
    <div id="scene-layer"></div>
    <div id="character-layer"></div>
    <div id="effect-layer"></div>
    <div id="choices-layer"></div>
    <div id="input-layer">
        <div id="input-box">
            <input type="text" id="player-input-field" autocomplete="off" />
            <button id="player-input-submit" class="input-submit-btn">확인</button>
        </div>
    </div>
    
    <div id="system-menu">
        <button class="sys-btn" onclick="openBacklog()">Log</button>
        <button class="sys-btn" onclick="openSaveMenu('save')">Save</button>
        <button class="sys-btn" onclick="openSaveMenu('load')">Load</button>
    </div>

    <!-- Backlog Modal -->
    <div id="backlog-modal" class="modal-overlay">
        <div class="modal-content">
            <div class="modal-header">
                <span>지난 대사 (Log)</span>
                <button class="modal-close" onclick="closeModal('backlog-modal')">×</button>
            </div>
            <div id="backlog-body" class="modal-body"></div>
        </div>
    </div>

    <!-- Save/Load Modal -->
    <div id="save-modal" class="modal-overlay">
        <div class="modal-content">
            <div class="modal-header">
                <span id="save-modal-title">저장 / 불러오기</span>
                <button class="modal-close" onclick="closeModal('save-modal')">×</button>
            </div>
            <div class="modal-body">
                <div id="slot-grid" class="slot-grid"></div>
            </div>
        </div>
    </div>

    <div id="ui-layer">
        <div id="dialogue-box">
            <div id="speaker-name"></div>
            <div id="dialogue-text"></div>
        </div>
    </div>
    <div id="start-overlay" style="background-color: #000; display: flex;">
        <h1>이드 연습</h1>
        <button id="start-btn" class="start-btn">게임 시작</button>
    </div>
</div>

            const escapedName = v.name.replace(/[.*+?^$\{()|[\]\\]/g, '\\$&');
            const regex = new RegExp('\\{\\{' + escapedName + '\\}\\}', 'g');
            result = result.replace(regex, String(variables[v.id]));
        });
        return result;
    }

    // --- Variables Logic ---
    function checkCondition(cond) {
        const val = variables[cond.variableId];
        const target = cond.value;
        switch(cond.operator) {
            case '==': return val == target;
            case '!=': return val != target;
            case '>': return val > target;
            case '<': return val < target;
            case '>=': return val >= target;
            case '<=': return val <= target;
            default: return false;
        }
    }
    function checkAllConditions(conditions) { if (!conditions || conditions.length === 0) return true; return conditions.every(checkCondition); }
    function executeActions(actions) {
        if (!actions) return;
        actions.forEach(a => {
            if (variables[a.variableId] === undefined) return;
            switch(a.type) {
                case 'set': variables[a.variableId] = a.value; break;
                case 'add': variables[a.variableId] += a.value; break;
                case 'subtract': variables[a.variableId] -= a.value; break;
                case 'toggle': variables[a.variableId] = !variables[a.variableId]; break;
            }
        });
    }

    const sceneLayer = document.getElementById('scene-layer');
    const characterLayer = document.getElementById('character-layer');
    const effectLayer = document.getElementById('effect-layer');
    const choicesLayer = document.getElementById('choices-layer');
    const inputLayer = document.getElementById('input-layer');
    const dialogueBox = document.getElementById('dialogue-box');
    const speakerName = document.getElementById('speaker-name');
    const dialogueText = document.getElementById('dialogue-text');
    const startOverlay = document.getElementById('start-overlay');
    const startBtn = document.getElementById('start-btn');

    function getAnimClass(id) { if (!id || id === 'none') return ''; return 'anim-' + id; }
    function getEffectClass(id) { if (!id || id === 'none') return ''; return 'fx-' + id; }
    function stopTyping() { if (typeWriterInterval) clearInterval(typeWriterInterval); isTyping = false; }
    function revealAllText() { stopTyping(); const spans = dialogueText.querySelectorAll('.char-span'); spans.forEach(span => span.classList.add('char-visible')); fullTextRevealed = true; }

    function updateCharacters(scene) {
        const existingWrappers = Array.from(characterLayer.children);
        existingWrappers.forEach(el => el.setAttribute('data-matched', 'false'));
        scene.characters.forEach(char => {
            const match = existingWrappers.find(el => { const img = el.querySelector('img'); return img && img.src === char.image && el.getAttribute('data-matched') === 'false'; });
            if (match) {
                match.setAttribute('data-matched', 'true');
                match.style.left = char.x + '%'; match.style.bottom = char.y + '%'; match.style.transform = 'translateX(-50%) scale(' + char.scale + ')';
                const img = match.querySelector('img'); img.className = 'character-img ' + getAnimClass(char.animation);
            } else {
                const wrapper = document.createElement('div'); wrapper.className = 'character-wrapper'; wrapper.setAttribute('data-matched', 'true'); wrapper.style.left = char.x + '%'; wrapper.style.bottom = char.y + '%'; wrapper.style.transform = 'translateX(-50%) scale(' + char.scale + ')';
                const img = document.createElement('img'); img.src = char.image; img.className = 'character-img ' + getAnimClass(char.animation);
                wrapper.appendChild(img); characterLayer.appendChild(wrapper);
            }
        });
        existingWrappers.forEach(el => { if (el.getAttribute('data-matched') === 'false') el.remove(); });
    }
    
    function updateEffect(scene) {
        effectLayer.className = '';
        if (scene.effect && scene.effect !== 'none') {
            const cls = getEffectClass(scene.effect);
            effectLayer.style.display = 'none'; effectLayer.offsetHeight; effectLayer.style.display = 'block'; effectLayer.classList.add(cls);
        }
    }

    function renderScene(sceneId) {
        stopTyping();
        fullTextRevealed = false;
        const scene = gameData.scenes.find(s => s.id === sceneId);
        if (!scene) {
            dialogueBox.style.display = 'none'; choicesLayer.style.display = 'none'; inputLayer.style.display = 'none';
            playBGM(null, 0, 0); alert("게임이 종료되었습니다.");
            if (gameData.showStartScreen !== false) startOverlay.style.display = 'flex';
            currentSceneId = null; return;
        }
        currentSceneId = sceneId;
        dialogueBox.style.display = 'block';
        const fullRawText = scene.segments.map(s => s.text).join(' ');
        const fullInterpolatedText = interpolate(fullRawText);
        if (backlog.length === 0 || backlog[backlog.length - 1].sceneId !== sceneId) {
             backlog.push({ sceneId: sceneId, speaker: interpolate(scene.speaker), text: fullInterpolatedText });
        }
        sceneLayer.style.backgroundImage = 'url("' + scene.background + '")';
        playBGM(scene.bgm, scene.bgmFadeIn || 0, scene.bgmFadeOut || 0);
        updateCharacters(scene);
        updateEffect(scene);
        dialogueBox.style.background = 'rgba(0, 0, 0, ' + (scene.dialogueBoxOpacity ?? 0.8) + ')';
        speakerName.textContent = interpolate(scene.speaker);
        dialogueText.innerHTML = ''; choicesLayer.innerHTML = ''; choicesLayer.style.display = 'none'; inputLayer.style.display = 'none';
        dialogueBox.style.pointerEvents = 'auto';
        const allSpans = [];
        if (scene.segments && scene.segments.length > 0) {
            scene.segments.forEach(seg => {
                const segWrapper = document.createElement('span'); segWrapper.className = 'text-anim-' + seg.animation; segWrapper.style.setProperty('--text-anim-duration', (seg.animationDuration || 1) + 's');
                const interpolatedSegText = interpolate(seg.text);
                interpolatedSegText.split('').forEach((char, idx) => {
                    const span = document.createElement('span'); span.textContent = char; span.className = 'char-span'; span.style.animationDelay = (idx * 0.05) + 's'; 
                    if (idx === 0 && seg.sound) span.setAttribute('data-se', seg.sound);
                    segWrapper.appendChild(span); allSpans.push(span);
                });
                if (seg !== scene.segments[scene.segments.length-1]) {
                   const space = document.createElement('span'); space.innerHTML = '&nbsp;'; space.className = 'char-span';
                   segWrapper.appendChild(space); allSpans.push(space);
                }
                dialogueText.appendChild(segWrapper);
            });
        }
        let charIndex = 0; isTyping = true;
        typeWriterInterval = setInterval(() => {
            if (charIndex >= allSpans.length) { stopTyping(); fullTextRevealed = true; finishTextReveal(scene); return; }
            const span = allSpans[charIndex]; span.classList.add('char-visible');
            const seSrc = span.getAttribute('data-se'); if (seSrc) playSE(seSrc);
            charIndex++;
        }, 30);
    }

    function finishTextReveal(scene) {
        if (scene.choices && scene.choices.length > 0) { showChoicesIfAny(scene); }
        else if (scene.inputConfig) { showInputBox(scene); }
        else if (scene.nextSceneId) { dialogueBox.style.pointerEvents = 'auto'; }
    }

    function showChoicesIfAny(scene) {
        const validChoices = scene.choices.filter(choice => checkAllConditions(choice.conditions));
        if (validChoices.length > 0) {
            choicesLayer.innerHTML = ''; choicesLayer.style.display = 'flex'; dialogueBox.style.pointerEvents = 'none'; 
            validChoices.forEach(choice => {
                const btn = document.createElement('button'); btn.className = 'choice-btn'; btn.textContent = interpolate(choice.text);
                btn.onclick = (e) => { e.stopPropagation(); executeActions(choice.actions); renderScene(choice.targetSceneId); };
                choicesLayer.appendChild(btn);
            });
        } else { if (scene.nextSceneId) dialogueBox.style.pointerEvents = 'auto'; }
    }

    function showInputBox(scene) {
        const config = scene.inputConfig;
        inputLayer.style.display = 'flex'; dialogueBox.style.pointerEvents = 'none';
        const field = document.getElementById('player-input-field');
        const submit = document.getElementById('player-input-submit');
        field.placeholder = config.placeholder || '';
        field.value = '';
        submit.textContent = config.buttonText || '확인';
        
        submit.onclick = () => {
            const val = field.value.trim();
            if (!val) return;
            variables[config.variableId] = val;
            inputLayer.style.display = 'none';
            let nextId = scene.nextSceneId || findNextLinearSceneId(currentSceneId);
            renderScene(nextId);
        };
        field.onkeydown = (e) => { if (e.key === 'Enter') submit.click(); };
        setTimeout(() => field.focus(), 100);
    }

    function findNextLinearSceneId(currentId) {
        const idx = gameData.scenes.findIndex(s => s.id === currentId);
        if (idx !== -1 && idx < gameData.scenes.length - 1) return gameData.scenes[idx + 1].id;
        return null;
    }

    startBtn.addEventListener('click', () => {
        BGM_PLAYER.play().then(() => BGM_PLAYER.pause()).catch(() => {});
        startOverlay.style.display = 'none';
        if (gameData.scenes.length > 0) renderScene(gameData.scenes[0].id);
    });

    dialogueBox.addEventListener('click', () => {
        if (!currentSceneId) return;
        if (isTyping) { revealAllText(); const currentScene = gameData.scenes.find(s => s.id === currentSceneId); finishTextReveal(currentScene); return; }
        if (fullTextRevealed) {
            const currentScene = gameData.scenes.find(s => s.id === currentSceneId);
            if ((currentScene.choices && currentScene.choices.length > 0) || currentScene.inputConfig) return;
            let nextId = currentScene.nextSceneId || findNextLinearSceneId(currentSceneId);
            if (nextId) renderScene(nextId);
        }
    });

    window.closeModal = (id) => { const modal = document.getElementById(id); if (modal) modal.style.display = 'none'; };
    window.openBacklog = () => {
        const modal = document.getElementById('backlog-modal'); const body = document.getElementById('backlog-body'); body.innerHTML = '';
        backlog.forEach(entry => {
            const div = document.createElement('div'); div.className = 'backlog-entry';
            div.innerHTML = '<div class="backlog-speaker">' + entry.speaker + '</div><div class="backlog-text">' + entry.text + '</div>';
            body.appendChild(div);
        });
        setTimeout(() => body.scrollTop = body.scrollHeight, 10); modal.style.display = 'flex';
    };

    window.openSaveMenu = (mode) => {
        const modal = document.getElementById('save-modal'); const title = document.getElementById('save-modal-title'); const grid = document.getElementById('slot-grid');
        title.textContent = mode === 'save' ? '게임 저장' : '게임 불러오기'; grid.innerHTML = '';
        for (let i = 1; i <= 3; i++) {
            const key = SAVE_KEY_PREFIX + i; const savedData = localStorage.getItem(key);
            let label = '<div class="slot-empty">비어있음</div>';
            if (savedData) {
                try {
                    const parsed = JSON.parse(savedData); const date = new Date(parsed.date);
                    const s = gameData.scenes.find(sc => sc.id === parsed.sceneId);
                    label = '<div class="slot-title">Slot ' + i + ': ' + (s ? s.name : 'Unknown') + '</div><div class="slot-date">' + date.toLocaleString() + '</div>';
                } catch(e) { label = '데이터 오류'; }
            } else { label = '<div class="slot-title">Slot ' + i + '</div>' + label; }
            const slot = document.createElement('div'); slot.className = 'save-slot'; slot.innerHTML = label;
            slot.onclick = () => {
                if (mode === 'save') {
                    if (confirm('Slot ' + i + '에 저장하시겠습니까?')) {
                        const state = { sceneId: currentSceneId, variables: variables, backlog: backlog, date: new Date().toISOString() };
                        localStorage.setItem(key, JSON.stringify(state)); alert('저장되었습니다.'); closeModal('save-modal');
                    }
                } else if (savedData) {
                    if (confirm('Slot ' + i + '를 불러오시겠습니까?')) {
                        const parsed = JSON.parse(savedData); variables = parsed.variables || {};
                        if (parsed.backlog) { backlog.length = 0; parsed.backlog.forEach(b => backlog.push(b)); }
                        closeModal('save-modal'); renderScene(parsed.sceneId);
                    }
                }
            };
            grid.appendChild(slot);
        }
        modal.style.display = 'flex';
    };

    if (gameData.showStartScreen === false && gameData.scenes.length > 0) renderScene(gameData.scenes[0].id);
</script>
